webpackJsonp([0xd0ca344457ac],{5860:function(e,t){e.exports={data:{post:{html:"<p>The ice has only gotten worse. It rained and thawed this afternoon, only to freeze again this evening. Large BMWs with rear-wheel drive are <em>not</em> able to negotiate ice-coated cobblestones, as Mama found out when taking Oma Ruth home. The BMW is now parked at the bottom of our street, waiting for better traction.</p>\n<p>All guests were able to make it to the Christmas feast, and more importantly, all were able to make it home safely.</p>",fields:{title:"Frozen In",date:"25 Dec 2002",url:"https://papascott.de/2002-12-25-frozen-in/"}}},pathContext:{slug:"/2002-12-25-frozen-in/",prev:{fields:{title:"Blitz Ice",date:"24 Dec 2002",slug:"/2002-12-24-blitz-ice/"}},next:{fields:{title:"Holiday Greetings",date:"26 Dec 2002",slug:"/2002-12-26-holiday-greetings/"}}}}}});
